#include <vector>
using namespace std;

class Solution {
public:
    vector<vector<int>> constructProductMatrix(vector<vector<int>>& grid) {
        int n = grid.size(), m = grid[0].size();
        vector<vector<int>> p(n, vector<int>(m));
        vector<int> prodRow(n, 1), prodCol(m, 1);

        // Calculate product of all elements except those in the same row or column
        // Initialize row and column products
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                prodRow[i] = (prodRow[i] * grid[i][j]) % 12345;
                prodCol[j] = (prodCol[j] * grid[i][j]) % 12345;
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                int totalProd = 1;
                // Exclude current row and column from the product
                for (int k = 0; k < n; k++) {
                    if (k != i) totalProd = (totalProd * grid[k][j]) % 12345;
                }
                for (int l = 0; l < m; l++) {
                    if (l != j) totalProd = (totalProd * grid[i][l]) % 12345;
                }
                p[i][j] = totalProd;
            }
        }

        return p;
    }
};
